import Footer from 'components/common/Footer';
import TopBanner from 'components/common/TopBanner';
import { HomePageComponentsWrapper } from 'pages/home';
import ArticleWrapper from 'pages/home/ArticleWrapper';
import ArticleWrapper2 from 'pages/home/ArticleWrapper2';
import GridArticle from 'pages/home/GridArticle';
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { CustomGet } from 'utils/api';
import {
	Article3Minutes,
	ArticleCareerEvent,
	CompanyDummy,
} from 'utils/mockData';
import CompanyRec from './CompanyRec';
import NotLoginArticle from './NotLoginArticle';
import Shortcut from './Shortcut';

function JobsfeedPage() {
	const [topBannerData, setTopBannerData] = useState(null);

	useEffect(() => {
		const topbanner = CustomGet({
			url: 'web/home/advertisments',
		});
		topbanner.then((res) => {
			switch (res.code) {
				case 1005:
					setTopBannerData(res.result);
					break;
				default:
			}
		});
	}, []);
	return (
		<HomePageComponentsWrapper>
			<TopBanner data={topBannerData} />
			<Shortcut />
			<NotLoginArticle />

			<div className="box-section-wrapper" style={{ marginTop: '70px' }}>
				<CompanyRec
					title="#연봉이 최고의 복지"
					icon="https://static.wanted.co.kr/images/tags/634f02e0-9f6e-11ec-b909-0242ac120002.png"
					data={CompanyDummy}
				/>
			</div>

			<div className="box-section-wrapper">
				<CompanyRec
					title="#퇴사율 10% 이하"
					icon="https://static.wanted.co.kr/images/tags/7d3cdb3c-9f6e-11ec-b909-0242ac120002.png"
					data={CompanyDummy}
				/>
			</div>

			<Footer />
		</HomePageComponentsWrapper>
	);
}

export default JobsfeedPage;
